	.rbx-refresh::after {
		transition: transform 1s ease-out !important;
		transform: rotate(0deg) !important;
		filter: invert(1);
		background-image: url(https://raw.githubusercontent.com/google/material-design-icons/master/png/navigation/refresh/materialiconsround/48dp/2x/round_refresh_black_48dp.png) !important;
		background-size: 150% 150% !important;
		background-position: center center !important;
	}

	.rbx-refresh:hover::after {
		transform: rotate(1turn) !important
	}
	.avatar {
		background: transparent !important;
	}

	.avatar-card-image {
/* 		box-shadow: inset 0 0 20px red; */
		border-radius: 50%;
		background: #212121 !important;
		border: 2px solid red !important;
		transition: border-radius 1s
	}

	.avatar-container img {
		background-color: transparent !important;
	}

	.avatar-card-image:hover {
		border-radius: 1em;
	}
	
	.game-card-thumb-container {
		box-shadow: inset 0 0 10px #00b06f;
		border: 2px solid #00b06f !important;
		overflow: hidden;
		border-radius: 20%;
		transition: border-radius 1s, box-shadow 1s,border 1s;
	}

	.notification-stream-wrap {
		right: initial;
	}
	.game-card-thumb-container:hover {
		border-radius: 8px;
		border-width: 0;
		box-shadow: inset 0 0 0px #00b06f;
	}
	.btn-common-play-game-lg {
		float: right;
		transition: box-shadow 1s;
	}
	.btn-common-play-game-lg, .btn-full-width.place-btn.btn-growth-sm, .profile-join-game {
		background: transparent !important;
		border: 2px solid #00b06f !important;
		box-shadow: inset 0 0 20px #00b06f;
		color: white !important;
		border-radius: 50px !important;
	}
	#game-details-play-button-container {
		display: grid;
		justify-content: right;
	}
	#nav-settings {
		background-image: url(https://raw.githubusercontent.com/google/material-design-icons/master/src/action/settings/materialiconsround/24px.svg) !important;
		filter: invert(1);
		background-position: center center !important;
		background-repeat: no-repeat;
		background-size: 100% 100% !important;
	}
    #navigation {
    background-color: rgba(0, 0, 0, 0);
	width: 60px;
		z-index: 1031;
		height: 100vh;
		top: 0;
}
	#header {
		display: flex;
/* 		align-items: baseline; */
		background: none;
		border: 0;
	}
	#container-main > .content {
		background: none;
	}
	#header .container-fluid {
		background: black;
		padding-left: 1em;
		padding-right: 1em;
		border-bottom-left-radius: 1em;
		border-bottom-right-radius: 1em;
	}
	#navigation {
		flex-direction: row-reverse;
	}
	#right-navigation-header {
		display: flex;
		flex-direction: row-reverse;
	}
	[data-testid="navigation-search-input"] {
		flex: 1;
		background: none !important;
	}
	#navigation div.font-header-2 {
		display: none !important;
	}
	.left-col-list li a, .left-col-list li button {
		display: flex;
		width: 40px;
		flex-direction: column;
		align-items: baseline;
		text-align: left;
	}
	.left-col-list li {
		width: min-content;
	}
	.left-col-list {
		display: flex;
		flex-direction: column;
		gap: 20px;
	}
	#navigation * {
/* 		overflow: visible; */
		font-size: 10px;
	}
	 #navigation > ul:nth-child(1) > li:nth-child(1) > a:nth-child(1), #navigation .rbx-divider, .navbar-header {
		display: none;
	}
body {
    background-image: url("https://img.guildedcdn.com/ContentMedia/302188c7bc26c9dc89857d858ffebe3c-Full.webp?w=1920&h=1080") !important;
    /* Background */
    background-attachment: fixed !important;
}
